import React from "react";
import logo from "../images/aranyagiri1.png";

const Header = () =>
{
    return(
            <div className= "ui segment">
                <div className="ui container center">
                    <div className= "ui center segment">
            
                        <div class="ui stackable three column grid">
                            <div class="three wide column" style={{color:"red",border:"1px red solid"}}>    
                                <img className="ui small image" src={logo} alt="Header" style={{border:"1px red solid"}}/> 
                            </div>

                            <div class="three wide column"style={{color:"red",border:"1px red solid"}}> 
                                <div class="ui huge label" style={{color:"red",border:"1px red solid"}}>
                                    अरण्यगिरी फार्म हाऊस
                                </div>                        
                            </div>

                    <div class="three wide column" style={{color:"red",border:"1px red solid"}}> 
                    <button class="medium ui button">
                         Bookings
                    </button></div>

                        </div>
               
            </div>      
                </div>
            </div>
    );
};

export default Header;
